import React, { Component } from 'react'

 class testcomp extends Component {

  constructor(props) {
    super(props)
  
    this.state = {
       user: '',
       comments: '',
       skill: ''
    }
  }

  handleChangeUserName = (event) => {
  this.setState ({
  user: event.target.value})
}
  handleChangeComments = (event) => {
  this.setState ({
  comments: event.target.value})
}
  handleChangeSkill = (event) => {
  this.setState ({
  skill: event.target.value})
}
  

  render() {
    return (
      <div>
        <form>
            <div>
                <label>UserName </label>
                <input type='text' value={this.state.user} onChange={this.handleChangeUserName}></input>
            </div>
            <div>
                <label>Comments</label>
                <textarea value={this.state.comments} onChange={this.handleChangeComments}></textarea>
            </div>
            <div>
                <label>Choose the Frame-Work - </label>
                <select value={this.state.skill}>
                    <option value='React'>React</option>
                    <option value='Angular'>Angular</option>
                    <option value='Vue'>Vue</option>
                </select>
            </div>
        </form>
      </div>
    )
  }
}

export default testcomp
